import { useState } from 'react';
import './App.css';
import Banner from './components/Banner';
import useUserIp from './hooks/useUserIp';


function App() {
  const [userIp, loadUserIp] = useState(userIp)

  loadUserIp(()=>{useUserIp(userIp)})

  return (<>
    <p>{ userIp }</p>
    <Banner />
  </>
  );
}


export default App;
